  true,\n\t\"url\": null,\n\t\"notes\": \"Much of the earth science research data
  available is shared acrossndepartments and agencies and often made available to
  the public. Butnsharing isn't enough. As federal organizations increasingly consult
  onenanother for expertise, the need for functional platforms that fosterncollaboration
  becomes vital.   The proposed innovation aims to developnthe tools for open source
  geobrowsers, specifically: COAST (CoastalnOn-line Assessment and Synthesis Tool)
  and NASA's World Wind Java (WWJ),nto communicate over local networks and the Internet
  to create a realncollaborative experience over computer desktops, greatly increasing
  thenquality of the decision support tools available to government agenciesnand emergency
  management, especially when it is most needed: just afterna disaster has struck.
  The ultimate objective would be to develop anfully interoperable virtual &amp;quot;geo-collaboration
  environment&amp;quot; ofnsoftware and hardware that delivers accurate information
  on emergingnsituations while collaborating with distributed partners, advisors,nspecialists
  and authorities in various jurisdictions.\",\n\t\"license_title\": \"U.S. Government
